import React from "react";


const experience = [
    {
        id: 1,
        title: 'Membership Specialist',
        desc: 'Maintaining and participating in the development of the membership register.',
        workplace: 'The Federation of Public and Private Sector Employees Jyty',
        time: '10/2018 - 8/2019',
    },
    {
        id: 2,
        title: 'Web Marketing Intern',
        desc: 'Worked on Koulutus.fi website. Managed SEO, usability, content, social media, marketing materials and customer service.',
        workplace: 'EMG - Educations Media Group',
        time: '2/2018 - 7/2018',
    },
    {
        id: 3,
        title: 'Sales Promoter',
        desc: 'Introducing products and representing brands to consumers in grocery stores and various events.',
        workplace: 'Foodbrands Nordic Oy',
        time: '8/2016 - 9/2017',
    },
    {
        id: 4,
        title: 'Airbnb Host',
        desc: "Managed customers' needs and maintained the cleanliness of the apartment.",
        workplace: '',
        time: '8/2014 - 10/2015',
    },
    {
        id: 5,
        title: 'Care Assistant',
        desc: 'Entertained elderly, e.g. played piano and did outdoor activities.',
        workplace: 'City of Helsinki',
        time: '6/2011 - 8/2011',
    },
    {
        id: 6,
        title: 'Personal Assistant',
        desc: 'Assisted a lady in the office. Helped her in daily matters. She had a muscular dystrophy disease.',
        workplace: 'City of Helsinki',
        time: '9/2007 - 4/2008',
    },
]

const Experience = ({ experience }) => {
    return (
    <li>
        <p>{experience.title} {experience.time}</p>
        <p>{experience.desc} {experience.workplace}</p>
    </li>
    )
}

const App = () => {

    return (

            <div className="grid-container">
                <div className="item1">About</div>
                <div className="item2">Skills</div>
                <div className="item3">
                    <h2>Experience</h2> 
                    <ul>
                        {experience.map(kaku => 
                            <Experience key={experience.id} kaku={experience} />
                        )}
                    </ul>
                </div>
            </div>

    )
}

export default App;
